const Header = () => {
    return (
      <div className="head">
        <div className="item icon">

        </div>
        <div className="item n_l">

        </div>
        <div className="item home">
            Home
        </div>
        <div className="item news">
            News
        </div>
        <div className="item messages">
            Messages
        </div>
      </div>
    );
  }

export default Header;
